import { makeStyles } from "@material-ui/core/styles";

export default makeStyles((theme) => ({
  mainLayout: {
    backgroundColor: "#8083c9",
  },
  root: {
    "& .MuiFormControl-root": {
      width: "100%",
      margin: theme.spacing(1),
    },
  },
  pageContent: {
    padding: theme.spacing(5),
    margin: theme.spacing(5),
  },
  coordinatorContainer: {
    width: "3%",
  },
  addButton: {
    marginTop: 10,
  },
  minusButton: {
    marginTop: 10,
  },
}));
